import React, { Component } from "react";
import style from "./style.module.css";

export class Movie extends Component {
  componentDidMount() {
    const { handle } = this.props.match.params;
    console.log(Handle);
  }

  render() {
    return <div className={style.movie}></div>;
  }
}

export default Movie;
